import React, { useState } from "react"
import { useParams, Outlet } from 'react-router-dom'

const PostPage = () => {
    const params = useParams()

    return (
        <div>
            <h1>Post Page</h1>
            <p>Post id: {params.id}</p>
        </div>
    )
}

export default PostPage
